Other Man, The (2008)  

Verenigde Staten / Verenigd Koninkrijk
Drama
90 minuten

geregisseerd door Richard Eyre
met Liam Neeson, Antonio Banderas en Laura Linney

Als Peter (Liam Neeson) begint te vermoeden dat hij niet de enige man in het leven van zijn vrouw (Laura Linney) is, besluit hij actie te ondernemen. Vastbesloten gaat hij op zoek naar zijn concurrent.

